import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

function Navbar() {
  return (
    <motion.nav
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      transition={{ duration: 0.8 }}
      className="bg-white/90 backdrop-blur-sm shadow-sm p-6 flex justify-between items-center"
    >
      {/* Logo and Company Name */}
      <div className="flex items-center space-x-3">
        <div className="w-10 h-10 bg-teal-500 rounded-full flex items-center justify-center">
          <svg className="w-6 h-6 text-white" fill="currentColor" viewBox="0 0 20 20">
            <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM4.332 8.027a6.012 6.012 0 011.912-2.706C6.512 5.73 6.974 6 7.5 6A1.5 1.5 0 019 7.5V8a2 2 0 004 0 2 2 0 011.523-1.943A5.977 5.977 0 0116 10c0 .34-.028.675-.083 1H15a2 2 0 00-2 2v2.197A5.973 5.973 0 0110 16a5.973 5.973 0 01-4.197-1.803A2 2 0 004 12v-2a2 2 0 00-1.668-1.973z" clipRule="evenodd" />
          </svg>
        </div>
        <div>
          <h1 className="text-xl font-bold text-gray-800">First Gulf</h1>
          <p className="text-sm text-gray-600">Travel Agency</p>
        </div>
      </div>

      {/* Navigation Links */}
      <div className="hidden md:flex space-x-8">
        <Link to="/" className="text-gray-800 hover:text-teal-600 font-medium">Home</Link>
        <Link to="/tours" className="text-gray-800 hover:text-teal-600 font-medium">Tours</Link>
        <Link to="/destinations" className="text-gray-800 hover:text-teal-600 font-medium">Destinations</Link>
        <Link to="/hotels" className="text-gray-800 hover:text-teal-600 font-medium">Hotels</Link>
        <Link to="/contact" className="text-gray-800 hover:text-teal-600 font-medium">Contact</Link>
      </div>

      {/* Contact Button */}
      <div className="flex items-center space-x-2">
        <button className="bg-white border border-teal-500 text-teal-600 px-4 py-2 rounded-lg flex items-center space-x-2 hover:bg-teal-50 transition-colors">
          <svg className="w-4 h-4" fill="currentColor" viewBox="0 0 20 20">
            <path d="M2 3a1 1 0 011-1h2.153a1 1 0 01.986.836l.74 4.435a1 1 0 01-.54 1.06l-1.548.773a11.037 11.037 0 006.105 6.105l.774-1.548a1 1 0 011.059-.54l4.435.74a1 1 0 01.836.986V17a1 1 0 01-1 1h-2C7.82 18 2 12.18 2 5V3z" />
          </svg>
          <span className="text-sm font-medium">+01000342117</span>
        </button>
      </div>
    </motion.nav>
  );
}

export default Navbar;
